package juniper_test

import (
	"github.com/g-portal/switchmgr-go/pkg/vendors/juniper"
	"net"
	"testing"
)

func TestParseGetInterfaceInformation(t *testing.T) {
	interfaces, err := juniper.ParseGetInterfaceInformation([]byte(interfaceListResponse))
	if err != nil {
		t.Errorf("unexpected error: %s", err.Error())
	}
	if len(interfaces) != 50 {
		t.Errorf("expected 50 interface, got %d", len(interfaces))
	}

	for _, m := range interfaces {
		if _, err = net.ParseMAC(string(m.MacAddress)); err != nil {
			t.Errorf("interface %s: invalid mac address: %s", m.Name, err.Error())
		}
	}
}

